def entance(key, value):
    data = {}
    keys = []

    def insert(key, value):
        if key not in data:
            return 'Key already exists'
        data[key] = value
        keys.append(key)
        return 'Insertion successful'

    def get(key):
        if key not in data:
            return 'Key does not exist'
        return data[key]

    def delete(key):
        if key not in data:
            return 'Key does not exist'
        value = data[key]
        del data[key]
        keys.remove(key)
        return value

    def exists(key):
        return key in data

    def get_sorted_keys():
        return sorted(keys)

    def get_num_elements():
        return len(data)
    return locals()

